// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TaskManagement {
    struct Task {
        uint256 id;
        string taskSet;
        string name;
        string slug;
        string efforts;
        string status;
        string deadline;
        uint256 completePercentage;
        string description;
        string addDate;
        string updateDate;
        uint256 company;
        uint256[] assign;
    }

    mapping(uint256 => Task) public tasks;
    uint256 public taskCount;

    event TaskAdded(
        uint256 indexed id,
        string taskSet,
        string name,
        string slug,
        string efforts,
        string status,
        string deadline,
        uint256 completePercentage,
        string description,
        string addDate,
        string updateDate,
        uint256 company,
        uint256[] assign
    );

    constructor(Task[] memory _tasks) {
        for (uint256 i = 0; i < _tasks.length; i++) {
            taskCount++;
            tasks[taskCount] = _tasks[i];
            emit TaskAdded(
                taskCount,
                _tasks[i].taskSet,
                _tasks[i].name,
                _tasks[i].slug,
                _tasks[i].efforts,
                _tasks[i].status,
                _tasks[i].deadline,
                _tasks[i].completePercentage,
                _tasks[i].description,
                _tasks[i].addDate,
                _tasks[i].updateDate,
                _tasks[i].company,
                _tasks[i].assign
            );
        }
    }

    function getTask(uint256 _id) public view returns (Task memory) {
        require(_id <= taskCount && _id > 0, "Invalid task ID.");
        return tasks[_id];
    }

    function getTaskCount() public view returns (uint256) {
        return taskCount;
    }
}
